import React from 'react';
import { makeStyles } from '@mui/styles';
import backgroundImage from './'

const useStyles = makeStyles(() => ({
    banner: {
    backgroundImage:"url()",
}}));



const Banner = () => {
    const classes = useStyles();
    return <div className={classes.banner}>Banner
      
    </div>;
  
}

export default Banner
